import React, { useState }from 'react';





function Wave(){
    const[height, setHeight] = useState({});
    const[direction, setDirection] = useState({});
    const[period, setPeriod] = useState({});




    const getInfo = () =>{
        const loc = {
            queensLat : 21.275532,
            queensLng : -157.827852
        }
        const params = 'swellHeight,swellDirection,swellPeriod';

        fetch(`https://api.stormglass.io/v2/weather/point?lat=${loc.queensLat}&lng=${loc.queensLng}&params=${params}`, {
            headers: {
              'Authorization': '947985f0-4e3b-11eb-a422-0242ac130002-947986ea-4e3b-11eb-a422-0242ac130002'
            }
          }).then((response) => response.json()).then((jsonData) => {
            console.log(jsonData);
          });
    }




    return (
        <div className="Weather">
            <main>
                <div className="wave-box">
                    <div className="info">
                        2ft at 14s SW
                        <button
                            onClick={getInfo}


                        >Click Me!

                        </button>

                    </div>


                </div>
            </main>
        </div>

    )
}
export default Wave;
